import React from 'react';

import './App.css';
import user from './user.json';
import Profile from './components/Profile/Profile';

function App() {
  return (
    <Profile
      name={user.name}
      tag={user.tag}
      location={user.location}
      avatar={user.avatar}
      stats={user.stats}
    />
  );
}

export default App;
